sys_variable_value.value:
(function execute(inputs, outputs) {

    var payload = {}
    if (inputs.sourceArchiveUrl)
        payload["sourceArchiveUrl"] = "gs://" + inputs.sourceArchiveUrl;
    if (inputs.description)
        payload["description"] = inputs.description;
    if (inputs.entryPoint.trim())
        payload["entryPoint"] = inputs.entryPoint.trim();
    if (inputs.timeout.trim())
        payload["timeout"] = inputs.timeout + "s".trim();
    if (inputs.availableMemoryMb.trim())
        payload["availableMemoryMb"] = inputs.availableMemoryMb.trim();
    if (inputs.serviceAccountEmail.trim())
        payload["serviceAccountEmail"] = inputs.serviceAccountEmail.trim();
    if (inputs.runtime.trim())
        payload["runtime"] = inputs.runtime.trim();
    if (inputs.ingressSettings)
        payload.ingressSettings = inputs.ingressSettings;
    if (inputs.vpcConnector)
        payload.vpcConnector = inputs.vpcConnector;
    if (inputs.vpcConnectorEgressSettings)
        payload.vpcConnectorEgressSettings = inputs.vpcConnectorEgressSettings;
    if (inputs.maxInstances)
        payload.maxInstances = inputs.maxInstances;
    var isLabels = false;
    if (inputs.labels.length > 0) {
        var labels = {};
        inputs.labels.forEach(function(label) {
            if (label.key.trim() && label.value.trim()) {
                labels[label.key.trim()] = label.value.trim();
                isLabels = true;
            }
        });
        if (isLabels)
            payload['labels'] = labels;
    }
    var isVariables = false;
    if (inputs.environmentVariables.length > 0) {
        var enVariables = {};
        inputs.environmentVariables.forEach(function(eVariable) {
            if (eVariable.name.trim() && eVariable.value.trim()) {
                enVariables[eVariable.name.trim().toString()] = eVariable.value.trim().toString();
                isVariables = true;
            }
        });
        if (isVariables)
            payload['environmentVariables'] = enVariables;
    }
    var updateMask = [];
    for (var i in payload) {
        updateMask.push(i);
    }
    if (updateMask.length < 0)
        throw new Error("Atleast one update is required");
    outputs.updatemask = updateMask.toString();
    outputs.location = inputs.location;
    outputs.projectid = inputs.projectid;
    outputs.function = inputs.function;
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

